import React from "react";

export default function ProfileLine({ digimon, length }) {
    const percent = Number.isInteger(digimon.percentage * 100) ? 
                    digimon.percentage * 100 :
                    (digimon.percentage * 100).toFixed(2);

    const lineStyle = {stroke:"#e6e6e6", strokeWidth: 5 + "px", strokeLinecap: "round"};

    return (
        <div className="line-wrapper">
            <span>{percent}%</span>
            <svg width={60} height={10} style={{transform: "rotateY(180deg)"}}>
                <line x1={0} y1={5} x2={50} y2={5} style={lineStyle}></line>
            </svg>
            {/* <span className={`line ${length}`}></span> */}
        </div>
    );
}
